import React from "react";
import "../styles/dashboard.css"

function DashboardNavBar(){
    return(
        <div className="navBar" >
            <ul className="remove-ul-style">
                <li className="nvUpperLeftOptions">
                    <button>
                        &#9776;
                    </button>
                </li>
                <li className="nvUpperLeftOptions"><div id="navbar-logo-container"><img id="navbar-logo" src="./images/virtual-version-log.png"></img></div></li>
                <li className="nvUpperLeftOptions">New Document</li>
            </ul>
        </div>
    );
}

export default DashboardNavBar;
